import React, { useState, useEffect } from 'react';
import Axios from 'axios';

const Homepage = () => {

	const [movieReviewList, setReviewList] = useState([])

	useEffect(() => {

		Axios.get(`http://localhost:3001/api/oneItem${sessionStorage.getItem("userImage")}`).then((response) => {
			setReviewList(response.data);
		})
	}, [])


	return (
		<div>
			{movieReviewList.map((val) => {

				return (

					<div class="myitem">

						<div class="leftItem">
							<img src={'http://localhost:3001/img/' + val.userid} alt="hey" id="imgItem"></img>
						</div>

						<div class="rightItem">
							<div class="card">
								<div class="card-text">
									<span class="date">4 days ago</span>
									<h2>Owner : {val.user_name}</h2>
									<h2>Price : {val.price} eth</h2>
								</div>
								<div class="card-stats">
									<div class="stat">
										<div class="value">4<sup>m</sup></div>
										<div class="type">read</div>
									</div>
									<div class="stat border">
										<div class="value">5123</div>
										<div class="type">views</div>
									</div>
									<div class="stat">
										<div class="value">32</div>
										<div class="type">comments</div>
									</div>
								</div>
							</div>

						</div>

					</div>




				)


			})}

		</div>
	)
};


export default Homepage
